@TimingChain hey TimingChain! :) No, it is not the closing price on the following day but the closing price during the day depending on the time frame in use. Most day/swing traders use the 5m, 15m, 30m,1h,4h, and the daily time frame when trading(I mainly use the daily, 5m, and 15m because it helps me determine the strength of the stock better). IMO, the terms spike, breakout, gapper can all be used interchangeably, and when I called out WWR on watch for a potential breakout a close over 3.00 and a close over 3.20 I mean there is strong resistance there and if a candle is able to close over it with volume as confirmation then it could be a major runner which it was. 
